import 'dart:convert';
import 'package:just_audio/just_audio.dart';

class SpellNumber {
  static final AudioPlayer _audioPlayer=AudioPlayer();


  /// Returns [value] plus 1.
  static Future<void> spellNumber(int number, {String langCode='wlf'}) async {
    String numberToString=(number~/5).toString().split('').reversed.join('');

    if(numberToString.length<=4) {
      await _spell(numberToString);
    }
    else if(numberToString.length>4 && numberToString.length<=6) {
      await _spell(numberToString.substring(3));
      //Diouni
      await playConcatAudios([
        AudioSource.uri(Uri.dataFromBytes(base64Decode(digitPositionSound[3]![langCode]!))),
        AudioSource.uri(Uri.dataFromBytes(base64Decode(digitValueSoundPath['and']![langCode]!)))
      ]);
      await _spell(numberToString.substring(0,3));
    }
    else if(numberToString.length>6 && numberToString.length<=9) {
      await _spell(numberToString.substring(6));
      //million
      await playConcatAudios([
        AudioSource.uri(Uri.dataFromBytes(base64Decode(digitPositionSound[6]![langCode]!))),
        AudioSource.uri(Uri.dataFromBytes(base64Decode(digitValueSoundPath['and']![langCode]!)))
      ]);
      await _spell(numberToString.substring(3,6));
      //Diouni
      await playConcatAudios([
        AudioSource.uri(Uri.dataFromBytes(base64Decode(digitPositionSound[3]![langCode]!))),
        AudioSource.uri(Uri.dataFromBytes(base64Decode(digitValueSoundPath['and']![langCode]!)))
      ]);
      await _spell(numberToString.substring(0,3));
      //cent
    }
    else
    {
      await _spell(numberToString.substring(9));
      //milliard
      await _spell(numberToString.substring(6,9));
      //million
      await playConcatAudios([
        AudioSource.uri(Uri.dataFromBytes(base64Decode(digitPositionSound[6]![langCode]!))),
        AudioSource.uri(Uri.dataFromBytes(base64Decode(digitValueSoundPath['and']![langCode]!)))
      ]);
      await _spell(numberToString.substring(3,6));
      //Diouni
      await playConcatAudios([
        AudioSource.uri(Uri.dataFromBytes(base64Decode(digitPositionSound[3]![langCode]!))),
        AudioSource.uri(Uri.dataFromBytes(base64Decode(digitValueSoundPath['and']![langCode]!)))
      ]);
      await _spell(numberToString.substring(0,3));
      //cent
    }
  }


  /// Returns [value] plus 1.
  static Future<void> _spell(String numberToString, {String langCode='wlf'}) async {
    List<UriAudioSource> digitSounds;
    for(int index=(numberToString.length-1); index>=0; index--) {
      if(numberToString[index] != '0') {
        digitSounds = <UriAudioSource>[
          AudioSource.uri(Uri.dataFromBytes(base64Decode(digitValueSoundPath['and']![langCode]!))),
          AudioSource.uri(Uri.dataFromBytes(base64Decode(digitValueSoundPath[numberToString[index]]![langCode]!))),
          AudioSource.uri(Uri.dataFromBytes(base64Decode(digitPositionSound[index]![langCode]!)))
        ];
        await setAndPlayDigitsAudio(numberToString[index], index, langCode, numberToString.length-1,digitSounds);
      }
    }
    //_audioPlayer.dispose();
  }

  static Future<void> setAndPlayDigitsAudio(String value,int index,String langCode,int length,List<UriAudioSource> digitSounds) async {

    if(value=="3" && index==1){
      if(index==length){
        digitSounds.removeAt(0);
        digitSounds.removeAt(0);
        digitSounds[0] = AudioSource.uri(Uri.dataFromBytes(base64Decode(digitValueSoundPath["30"]![langCode]!)));
      }
      else {
        digitSounds[1] = AudioSource.uri(Uri.dataFromBytes(base64Decode(digitValueSoundPath["30"]![langCode]!)));
        digitSounds.removeAt(2);
      }
    }
    else if(value=="1" && index!=0) {
      if(index==length) {
        digitSounds.removeAt(0);
        digitSounds.removeAt(0);
      }
      else {
        digitSounds.removeAt(1);
      }
    }
    else if(index==0) {
      if(index==length) {
        digitSounds.removeAt(0);
        digitSounds.removeAt(1);
      }
      else {
        digitSounds.removeAt(2);
      }
    }
    else if(length==index) {
      digitSounds.removeAt(0);
    }
    /*  final playlist = ConcatenatingAudioSource(
      // Customise the shuffle algorithm
        shuffleOrder: DefaultShuffleOrder(),
        // Specify the playlist items
        children: value=="3" && index==1?
        <UriAudioSource>[
          AudioSource.uri(Uri.dataFromBytes(base64Decode(digitValueSoundPath["30"][langCode]))),
          AudioSource.uri(Uri.dataFromBytes(base64Decode(digitValueSoundPath['and'][langCode])))
        ]: value=="1" && index!=0 ?
        <UriAudioSource>[
          AudioSource.uri(Uri.dataFromBytes(base64Decode(digitPositionSound[index][langCode]))),
          AudioSource.uri(Uri.dataFromBytes(base64Decode(digitValueSoundPath['and'][langCode])))
        ]: index!=0?
        <UriAudioSource>[
          AudioSource.uri(Uri.dataFromBytes(base64Decode(digitValueSoundPath[value][langCode]))),
          AudioSource.uri(Uri.dataFromBytes(base64Decode(digitPositionSound[index][langCode]))),
          AudioSource.uri(Uri.dataFromBytes(base64Decode(digitValueSoundPath['and'][langCode])))
        ]:
        <UriAudioSource>[AudioSource.uri(Uri.dataFromBytes(base64Decode(digitValueSoundPath[value][langCode])))]
    );*/

    await playConcatAudios(digitSounds);
  }


  static Future<void> playConcatAudios(List<UriAudioSource> digitSounds) async {
    await _audioPlayer.setAudioSource(ConcatenatingAudioSource(shuffleOrder: DefaultShuffleOrder(), children: digitSounds), initialIndex: 0,initialPosition: Duration.zero);
    await _audioPlayer.play();
    await _audioPlayer.stop();
  }

